import React from 'react';
import './Tile.css';

class Tile extends React.Component{
    render(){
        return(
            <div className="tile">
                <div className="image-container">
                    <a href={this.props.path}><img className="picture" src={this.props.tileImageSrc} /></a>
                </div>
                <a className="name">{this.props.name}</a>
            </div>
        )
    }
}

export default Tile;
